import java.util.*;

public class Main {
    static int[][] top, front;
    static int[][] right;
    static Set<Integer> sums = new HashSet<>();

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        scanner.nextLine();

        for (int i = 0; i < n; i++) {
            top = new int[3][3];
            front = new int[3][3];
            right = new int[3][3];

            for (int j = 0; j < 3; j++) {
                for (int k = 0; k < 3; k++) {
                    top[j][k] = scanner.nextInt();
                    front[j][k] = scanner.nextInt();
                }
                scanner.nextLine();
            }

            dfs(0, 0, 0);

            if (sums.isEmpty()) {
                System.out.println("0");
            } else {
                List<Integer> list = new ArrayList<>(sums);
                Collections.sort(list);
                for (int num : list) {
                    System.out.print(num + " ");
                }
                System.out.println();
            }
        }
    }

    static void dfs(int x, int y, int sum) {
        if (x == 3) {
            for (int i = 0; i < 3; i++) {
                for (int j = 0; j < 3; j++) {
                    right[i][j] = 0;
                }
            }
            for (int i = 0; i < 3; i++) {
                for (int j = 0; j < 3; j++) {
                    if (top[i][j] == 0) {
                        for (int k = 1; k <= 6; k++) {
                            if (front[i][j] + k == 7) {
                                right[i][j] = k;
                                break;
                            }
                        }
                    } else {
                        right[i][j] = 7 - front[i][j];
                    }
                }
            }
            int total = 0;
            for (int i = 0; i < 3; i++) {
                for (int j = 0; j < 3; j++) {
                    total += right[i][j];
                }
            }
            sums.add(total);
            return;
        }

        for (int num = 1; num <= 6; num++) {
            if (x == 0 && y == 0 && num == 1) continue;
            if (top[x][y] == 0) {
                if (front[x][y] + num == 7) {
                    top[x][y] = num;
                    dfs(x + 1, y, sum + num);
                    top[x][y] = 0;
                }
            } else {
                if (front[x][y] + num == 7) {
                    dfs(x + 1, y, sum + num);
                }
            }
        }
    }
}
